import React from "react";
import Heading from "../components/Heading";
import { featured1 } from "../assets/images/products";
import { DeleteIcon, ShoppingCartOutlinedIcon} from "../assets/icons";

const WishPage = () => {
  return (
    <section className="max-container my-10 bg-orange-200 p-2">
      <Heading title={"Wishlist"} heading={"Wishlist (4)"} />
      <div className="grid grid-cols-6">
        <div className="max-h-96 rounded-md mx-auto">
          <div className="w-full  object-cover relative bg-orange-100">
            <img src={featured1} className="max-h-56 p-1 w-full" alt="" />
            <span className="absolute top-3  right-1">
              <DeleteIcon />
            </span>
            <button className="bg-orange-500 w-full text-white font-medium p-1"><ShoppingCartOutlinedIcon /> Add to cart</button>
          </div>
          <h1 className="text-sm font-semibold">
            Gucii Printed T-shirt
          </h1>
          <p className="text-xs font-medium">
            Kids Teen Controller
          </p>
          <div className="flex items-center gap-1 max-md:text-[8px]">
            <p className="font-semibold text-xs">₹1,199</p>
            <p className="line-through ">₹1,399</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default WishPage;
